export const ProjRoles = (props) => {
    return (
        <div className="container">
            <h1 style={{textAlign: 'center',color: '#6372ff'}}>Team Roles</h1>
            <h3 >Learn more about each of the 3 roles every project has! 
                Each category is coordinated with themed workshops that help
                students develop production-level code.
            </h3>
            <div>
                {props.data.analysisRole}
            </div>

        </div>
    );
}
